import React from 'react';
import PDFViewer from './components/PDFViewer';
import { SocketProvider } from './context/SocketContext';
import './App.css';

const App = () => {
  return (
    <SocketProvider>
      <div className="app">
        <h1>PDF Co-Viewer</h1>
        <PDFViewer isAdmin={true} /> {/* Pass isAdmin=true for admin */}
      </div>
    </SocketProvider>
  );
};

export default App;
